import Container from "react-bootstrap/Container";

function MyFooter() {
  return (
    <Container>
      <div className="p-5 bg-danger text-white rounded">
        <ul>
          <li></li>
        </ul>
      </div>
    </Container>
  );
}

export default MyFooter;
